import logo from './logo.svg';
import './App.css';
import React from 'react';
import Home from './pages/Home';
import Upload from './pages/Upload';
import Records from './pages/Records';
import ViewData from './pages/ViewData';

function App() {

  const [recargarColecciones, setRecargarColecciones] = useState(false);

  // Llamado desde Upload para indicar que se debe recargar
  const notificarNuevaColeccion = () => {
    setRecargarColecciones(prev => !prev);  // cambia el valor para que ViewData se entere
  };

 return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>

      <Home />

      <Upload onUploadSuccess={notificarNuevaColeccion} />

      <ViewData />

    </div>
  );

}

export default App;
